import React from "react";
import { Grid } from "@mui/material";

const DayDraggable = (props) => {
    return (
        <Grid container border={1} alignItems={'center'} borderRadius={6}>
            <Grid item xs={12} fontSize={24}>
                {props.title}
            </Grid>
            <Grid item xs={12} fontSize={14}>
                {props.description}
            </Grid>
        </Grid>
    )
}

export default DayDraggable;
